interface EventPerformanceMeasure {
    start: number
    end: number
}

interface EventPerformanceData {
    pointsInTime: Record<string, number>
    durations: Record<string, EventPerformanceMeasure>
    maxTime: number
    gridMarkers: number[]
}

function forWaterfallDisplay(pageViewEvent: EventType): EventPerformanceData {
    // TODO will become the logic

    const perfData = JSON.parse(pageViewEvent.properties.$performance_raw)
    const navTiming: PerformanceNavigationTiming = perfData.navigation[0]
    let maxTime = 0

    const pointsInTime = {}
    if (navTiming.domComplete) {
        pointsInTime['domComplete'] = navTiming.domComplete
    }
    if (navTiming.domInteractive) {
        pointsInTime['domInteractive'] = navTiming.domInteractive
    }

    if (navTiming.duration) {
        pointsInTime['pageLoaded'] = navTiming.duration
        maxTime = navTiming.duration > maxTime ? navTiming.duration : maxTime
    }

    const durations: Record<string, EventPerformanceMeasure> = {}
    if (navTiming.domainLookupEnd && navTiming.domainLookupStart) {
        durations['dns lookup'] = { start: navTiming.domainLookupStart, end: navTiming.domainLookupEnd }
        maxTime = navTiming.domainLookupEnd > maxTime ? navTiming.domainLookupEnd : maxTime
    }

    if (navTiming.connectEnd && navTiming.connectStart) {
        durations['connection time'] = { start: navTiming.connectStart, end: navTiming.connectEnd }
        maxTime = navTiming.connectEnd > maxTime ? navTiming.connectEnd : maxTime
    }

    if (navTiming.connectEnd && navTiming.secureConnectionStart) {
        durations['tls time'] = { start: navTiming.secureConnectionStart, end: navTiming.connectEnd }
        maxTime = navTiming.connectEnd > maxTime ? navTiming.connectEnd : maxTime
    }

    if (navTiming.responseStart && navTiming.requestStart) {
        durations['waiting for first byte (TTFB)'] = { start: navTiming.requestStart, end: navTiming.responseStart }
        maxTime = navTiming.responseStart > maxTime ? navTiming.responseStart : maxTime
    }

    perfData.resource.forEach((resource: PerformanceResourceTiming) => {
        const resourceURL = new URL(resource.name)
        durations[resourceURL.pathname] = { start: resource.startTime, end: resource.responseEnd }
        maxTime = resource.responseEnd > maxTime ? resource.responseEnd : maxTime
    })

    return {
        pointsInTime,
        durations: durations,
        maxTime,
        gridMarkers: Array.from(Array(10).keys()).map((n) => n * (maxTime / 10)),
    }
}

interface PerfBlockProps {
    start: number
    end: number
    max: number | undefined
}

function PerfBlock({ start, end, max }: PerfBlockProps): JSX.Element {
    if (max) {
        const left = (start / max) * 100
        const right = 100 - (end / max) * 100
        const blockSides = { left: `${left}%`, right: `${right}%` }
        const textPosition = { left: `${100 - right + 1}%`, right: `${right}%` }
        return (
            <>
                <div className="performance-block positioned" style={blockSides} />
                <div className="positioned" style={textPosition}>
                    {Math.round(end)}ms
                </div>
            </>
        )
    } else {
        return <></>
    }
}

function VerticalMarker({
    max,
    position,
    color,
    bringToFront,
}: {
    max: number | undefined
    position: number
    color: string
    bringToFront?: boolean
}): JSX.Element {
    if (max) {
        const left = (position / max) * 100
        return (
            <div
                className={clsx(['vertical-marker', { 'in-front': bringToFront }])}
                style={{ left: `${left}%`, backgroundColor: color }}
            />
        )
    } else {
        return <></>
    }
}

function WaterfallChart({ currentEvent }: { currentEvent: EventPerformanceData | null }): JSX.Element {
    return (
        <>
            {currentEvent && (
                <Row>
                    <Col span={8}>
                        {Object.entries(currentEvent.durations).map(([marker]) => {
                            return (
                                <Row key={marker} className="marker-name marker-row">
                                    {marker}
                                </Row>
                            )
                        })}
                    </Col>
                    <Col span={16}>
                        {Object.entries(currentEvent.pointsInTime).map(([key, time]) => (
                            <Tooltip title={key} key={key}>
                                <VerticalMarker
                                    position={time}
                                    max={currentEvent?.maxTime}
                                    color={'red'}
                                    bringToFront={true}
                                />
                            </Tooltip>
                        ))}
                        {currentEvent.gridMarkers.map((gridMarker) => (
                            <VerticalMarker
                                key={gridMarker}
                                max={currentEvent?.maxTime}
                                position={gridMarker}
                                color={'var(--border-light)'}
                            />
                        ))}
                        {Object.entries(currentEvent.durations).map(([marker, times]) => (
                            <Row key={marker} className={'marker-row'}>
                                <PerfBlock start={times.start} end={times.end} max={currentEvent?.maxTime} />
                            </Row>
                        ))}
                    </Col>
                </Row>
            )}
        </>
    )
}

function EventsWithPerformanceTable(props: { setEventToDisplay: (x: EventType) => void }): JSX.Element {
    const columns: LemonTableColumns<EventType> = [
        {
            title: 'URL / Screen',
            key: 'url',
            render: function RenderURL(_: any, pageViewEvent: EventType) {
                const param = pageViewEvent.properties['$current_url'] ? '$current_url' : '$screen_name'
                return <Property value={pageViewEvent.properties[param]} />
            },
        },
        {
            title: 'Time',
            render: function RenderTime(_: any, pageViewEvent: EventType) {
                return <TZLabel time={dayjs(pageViewEvent.timestamp)} formatString="MMMM DD, YYYY h:mm" />
            },
        },
        {
            title: 'Page Load Time',
            render: function RenderPageLoad(_: any, pageViewEvent: EventType) {
                const duration = pageViewEvent.properties['$performance_pageLoaded']
                return <span>{duration}ms</span>
            },
        },
        {
            render: function RenderPlayButton(_: any, pageViewEvent: EventType) {
                return (
                    <div>
                        <Button data-attr={`view-waterfall-button-${pageViewEvent.id}`} icon={<EyeOutlined />}>
                            View waterfall chart
                        </Button>
                    </div>
                )
            },
        },
    ]

    return (
        <LemonTable
            dataSource={pageViewEvents}
            columns={columns}
            loading={false}
            onRow={(pageViewEvent) => ({
                onClick: () => {
                    props.setEventToDisplay(pageViewEvent)
                },
            })}
            rowClassName="cursor-pointer"
            data-attr="session-recording-table"
        />
    )
}

export function PerformanceWaterfall(): JSX.Element {
    const [eventToDisplay, setEventToDisplay] = useState<EventType | null>(null)
    const currentEvent: EventPerformanceData | null = useMemo(() => {
        return eventToDisplay ? forWaterfallDisplay(eventToDisplay) : null
    }, [eventToDisplay])
    return (
        <div className="apm-performance-waterfall">
            <PageHeader
                title={
                    <Row align="middle">
                        Web Performance
                        <LemonTag type="warning" style={{ marginLeft: 8 }}>
                            Beta
                        </LemonTag>
                    </Row>
                }
            />
            <Space direction="vertical">
                <EventsWithPerformanceTable setEventToDisplay={setEventToDisplay} />
                <WaterfallChart currentEvent={currentEvent} />
            </Space>
        </div>
    )
}
